INSERT INTO `feedback` VALUES (5,'LYNC头衔变更问题','发现此次更新之后，LYNC的头衔本地头像的没有变化，只在别人LYNC中才能看到自己的头像已经变化了。不知是什么问题？',2,'chuanchuan.liu','2013-11-18 14:30:15','你好：\r\n应该是你本地lync客户端的更新未成功造成的。因此才会在别人lync上都正常，只有自己客户端的lync显示没有变化。\r\n已安排工程师给您查看原因。'),(6,'昌平办公区一楼采集部无线网络信号极差','有线网络接口不够，很多同事使用无线。但是无线网络很差，最近老是自己一会断网掉线一会自己又连，而且连起来要很长时间，大概2到3分钟；有时直接显示无线信号是一小格；邮箱邮件收发速度都比别人有线慢很久。我已经截图，可以提供截图参考。期待能够提供正常的无线网络信号或者想办法增加有线网线接口，方便正常办公，谢谢！期待您的答复！',2,'mingfeng.mei','2013-11-21 11:33:52','按原来规划，无线并不是昌平办公区的标准接入方式之一。但是由于人员增加，原有的有线网络并不能满足大家办公需要，因此无线问题在最近才逐渐突出。\r\nIT部对应昌平办公区的整体无线网络改造已经开始，预计春节前结束。如果你的位置的无线网络已经影响工作使用，我们会临时增加无线访问点在你的位置附近。预计周五下班前可以完成，谢谢！'),(7,'维修或安装系统的电脑长期不领出的问题','三地均出现此情况，部门将电脑放置IT部后，长期不领走，如遇机器编码粘贴不牢脱落，丢失编码后，IT部与资产部的同事将无法通知使用部门。建议IT部加强这方面的管理，增加设备进出登记表。',2,'jiayan.zhang','2013-11-22 14:42:25','您提的问题其实是两个方面的问题：\r\n（1)资产长期在IT部放置的问题：增加《设备进出登记表》，退库电脑在IT部接收后3个工作日之内必须退库（该流程在2013年12月1日开始3地执行）;\r\n（2)标签脱落丢失的问题：大部分情况都是电脑在员工归还给IT部的时候就已经丢失了机器编码。针对资产标签缺失，我们将改进目前的退库单，上面新增加资产编号项，针对退库到IT部的没有资产编号的机器需要部门核对资产编号后才进行接收。(该流程2013年11月25日起开始执行）'),(8,'关于工单的类目','能否在在类目底下，增加一个“其它”选项，有很多IT问题不在提供的类目中，没法选了。',2,'朱伟(架构平台中心)','2013-11-26 19:06:28','你好！已经增加“其他”选项。\r\n感谢反馈。'),(9,'增加A3彩打','您好！有A3彩打的工作需求，外出打印很不方便，报销也很麻烦，申请增加，非常感谢。',1,'徐慧琳','2013-12-02 10:33:35','你好。\r\n目前方恒办公区IT部提供的公共打印机都不支持A3彩打功能。在今后的打印机更换时，我们会考虑支持A3彩打的打印机。'),(10,'邮件搜索问题','昌平办公区按发件人名称等条件搜索邮件经常发生只能搜索到某天之前的邮件，搜索不到最新的邮件。不方便邮件的查找。每天有几百封的邮件，不能有效搜索，给工作带来不便。请协助解决！',1,'孙旭','2013-12-02 17:12:20','确认问题的情况是新收到的邮件通过马上创建搜索没有办法搜索到，这个问题原因应该是邮件搜索需要等待索引创建完成，新收到的邮件需要等待几分钟创建索引。'),(11,'test','test',2,'admin','2013-12-23 17:20:11','test');
